import Loadable from 'app/components/Loadable';
import { lazy } from 'react';
import { authRoles } from '../../auth/authRoles';

const RoleRoute = Loadable(lazy(() => import('./RoleRoute')));
const AdminAnalytics = Loadable(lazy(() => import('../admin/AdminAnalytics')));
const HospitalAnalytics = Loadable(lazy(() => import('../hospital/HospitalAnalytics')));
const ServiceProviderAnalytics = Loadable(lazy(() => import('../service_provider/ServiceProviderAnalytics')));
const DriverAnalytics = Loadable(lazy(() => import('../driver/DriverAnalytics')));

const dashboardRoutes = [
  { path: '/netcare', element: <RoleRoute />, auth: authRoles.all},
  { path: '/netcare/admin', element: <AdminAnalytics />, auth: authRoles.admin },
  { path: '/netcare/hospital', element: <HospitalAnalytics />, auth: authRoles.hospital },
  { path: '/netcare/service_provider', element: <ServiceProviderAnalytics />, auth: authRoles.sp },
  { path: '/netcare/dashboard/driver', element: <DriverAnalytics />, auth: authRoles.sp },
];

export default dashboardRoutes;
